package Array;

public class _2DArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
int arr[][]={{21,12,23,32,43},{54,45,65,67,78}};
	
//printing 2d array
for (int i=0;i<4;i++)
{
	for(int j=0;j<4;j++)
	{
		System.out.print(arr[i] [j]+ " ");
	}
	System.out.println();
}

	}

}
